    function setBaseURI(string memory baseURIPrefix) external onlyOwner {
        _baseURIPrefix = baseURIPrefix;
    }

    function _baseURI() internal view override returns (string memory) {
        return _baseURIPrefix;
    }

    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal whenNotPaused override(ERC721, ERC721Pausable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    /**
     * @dev Converts a `uint256` to its ASCII `string` decimal representation.
     */
    function toString(uint256 value) internal pure returns (string memory) {
        // Inspired by OraclizeAPI's implementation - MIT licence
        // https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol

        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

    function beforeMint(uint256 numberOfMints) internal view {
        address sender = _msgSender();
        require(!sender.isContract() && tx.origin == sender, "Bots have no power here!");
        require(_tokenIds.current() + numberOfMints <= totalSupply, "Maximum amount of tokens already minted");
    }

    function mintPass_EWa9pesKnnMe(address wallet) whenNotPaused external returns (uint256) {
        uint256 numberOfMints = getMintPass(wallet).mul(2);

        uint mpFromSnap = IERC20(snapAddress).balanceOf(wallet).div(snapSupplyToMintPass);
        numberOfMints = numberOfMints.add(mpFromSnap.mul(2));

        if (numberOfMints > buyLimitMintPass) {
            numberOfMints = buyLimitMintPass;
        }

        require(numberOfMints > 0, "Cannot claim");

        beforeMint(numberOfMints);

        require(numberOfMints <= buyLimitMintPass, "You reached buy limit from single tx");
        require(!mintPassClaimed[wallet], "You reached wallet limit");

        mintPassClaimed[wallet] = true;
        doMint(wallet, numberOfMints);
        emit MintPassClaimed(wallet, numberOfMints);

        return _tokenIds.current();
    }

    function mintWhitelist_kJipc46qGX3K(address wallet, uint256 numberOfMints) whenNotPaused external payable returns (uint256) {
        beforeMint(numberOfMints);

        require(modeWhitelist, "Invoke same method but for public sale");
        require(numberOfMints <= buyLimitWhitelist, "You reached buy limit from single tx");
        require(mintedWhiteList[wallet].add(numberOfMints) <= buyLimitWhitelist, "You reached wallet limit");
        require(msg.value >= fee * numberOfMints, "Fee is not correct.");

        mintedWhiteList[wallet] = mintedWhiteList[wallet].add(numberOfMints);
        doMint(wallet, numberOfMints);

        return _tokenIds.current();
    }

    function mintPublic_NbrluxKI1WhB(address wallet, uint256 numberOfMints) whenNotPaused external payable returns (uint256) {
        beforeMint(numberOfMints);

        require(numberOfMints <= buyLimitPublicSale, "You reached buy limit from single tx");
        require(msg.value >= fee * numberOfMints, "Fee is not correct.");

        doMint(wallet, numberOfMints);

        return _tokenIds.current();
    }

    function doMint(address wallet, uint numberOfMints) private {
        for(uint i = 0; i < numberOfMints; i++) {
            _tokenIds.increment();
            uint256 tokenId = _tokenIds.current();
            _safeMint(wallet, tokenId);

            string memory tokenURISuffix = string(abi.encodePacked(toString(tokenId),  ".json"));
            _setTokenURI(tokenId, tokenURISuffix);
        }
    }

    function mintOwner() private onlyOwner returns (uint256) {
        require(_tokenIds.current() == 0);

        doMint(msg.sender, 200);

        return _tokenIds.current();
    }

    function mintSpecial(address wallet) external onlyOwner returns (uint256) {
        doMint(wallet, 1);
        totalSupply = totalSupply.add(1);
        return _tokenIds.current();
    }

    function setTotalSupply(uint256 _totalSupply) external onlyOwner {
        totalSupply = _totalSupply;
    }

    function setFee(uint256 _fee) external onlyOwner {
