    }

    function getFee() external view returns (uint) {
      return fee;
    }

    function cashOut() external {
        require(msg.sender == cashOutCallers[0] || msg.sender == cashOutCallers[1] || msg.sender == cashOutCallers[2] || msg.sender == cashOutCallers[3] || msg.sender == cashOutCallers[4] || msg.sender == cashOutCallers[5], "Should be called with whitelisted wallet");
        cashOutWallet.call{value: address(this).balance}("");
    }

